import React from "react";
import { Grid, TextField } from "@material-ui/core";

export const TextFormField = props => {
  return (
    <Grid item xs={12}>
      <TextField
        fullWidth
        label={props.label}
        type={props.type}
        name={props.name}
        placeholder={props.label}
        value={null}
        onChange={null}
      />
    </Grid>
  );
};

export const fieldData = [
  { label: "Grant Name", type: "text", name: "competition_name" },
  { label: "Website", type: "url", name: "website" },
  { label: "Amount", type: "number", name: "amount" },
  { label: "Amount Notes", type: "text", name: "amount_notes" }
];
